/*Table structure for table `fact_rental` */

DROP TABLE IF EXISTS `fact_rental`;

CREATE TABLE `fact_rental` (
  `id` int NOT NULL AUTO_INCREMENT,
  `dim_geografica_sk` int NOT NULL,
  `dim_film_sk` int NOT NULL,
  `dim_tiempo_sk` int NOT NULL,
  `pay_amount` decimal(2,0) DEFAULT NULL,
  `pelicula` int DEFAULT NULL,
  PRIMARY KEY (`id`,`dim_tiempo_sk`),
  KEY `fk_fact_rental_dim_geografica1_idx` (`dim_geografica_sk`),
  KEY `fk_fact_rental_dim_film1_idx` (`dim_film_sk`),
  KEY `fk_fact_rental_dim_tiempo1_idx` (`dim_tiempo_sk`),
  CONSTRAINT `fk_fact_rental_dim_film1` FOREIGN KEY (`dim_film_sk`) REFERENCES `dim_film` (`sk`),
  CONSTRAINT `fk_fact_rental_dim_geografica1` FOREIGN KEY (`dim_geografica_sk`) REFERENCES `dim_geografica` (`sk`),
  CONSTRAINT `fk_fact_rental_dim_tiempo1` FOREIGN KEY (`dim_tiempo_sk`) REFERENCES `dim_tiempo` (`sk`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

