/* Procedure structure for procedure `antDIM_TIEMPO` */

/*!50003 DROP PROCEDURE IF EXISTS  `antDIM_TIEMPO` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `antDIM_TIEMPO`()
BEGIN
 
DELETE FROM DIM_TIEMPO;
 SET lc_time_names = 'es_VE';
SELECT '2005-01-01' INTO @fi; 
SELECT '2006-12-31' INTO @ff; 
 
 
WHILE (@fi <= @ff) DO 
  
INSERT INTO DIM_TIEMPO
    (
        sk_date,
        Fecha,
        Anio,
        Trimestre,
        Mes,
        Semana,
        Dia,
        DiaSemana,
        NTrimestre,
        NMes,
        NMes3L,
        NSemana,
        NDia,
        NDiaSemana,
        Aniomes
    )
SELECT YEAR(@fi)*10000+MONTH(@fi)*100+DAY(@fi) AS sk_date,
        (@fi) Fecha,
        YEAR(@fi) Anio,
        QUARTER(@fi) Trimestre,
        MONTH(@fi) Mes,
        WEEK(@fi) Semana,
        RIGHT(CONCAT('0',DAY(@fi)),2) Dia,
        WEEKDAY(@fi) DiaSemana,
        CONCAT('T',QUARTER(@fi),'/',YEAR(@fi))NTrimestre,
        MONTHNAME(@fi) NMes,
        upper(LEFT(MONTHNAME(@fi),3)) NMes3L,
        CONCAT('Sem ',WEEK(@fi) ,'/', YEAR(@fi)) NSemana,
        CONCAT(RIGHT(CONCAT('0',DAY(@fi)),2),' ',MONTHNAME(@fi)) NDia,
        DAYNAME(@fi) NDiaSemana,
        concat(YEAR(@fi),lpad(MONTH(@fi),2,'0'));
 
SET @fi = DATE_ADD(@fi, INTERVAL 1 DAY); 
 
END WHILE;
END */$$
DELIMITER ;

